import { render } from "@testing-library/react";
import React from "react";

const Necas = ({ text }) => {
  console.log(text);
  render();
  {
    const items = [];

    text.Search.map((t, index) =>
      items.push(<li key={index}>{`Coiso ${t.Title}`}</li>)
    );
    console.log(items);
    return <div>{items}</div>;
  }
};

Necas.defaultProps = {
  text: ["Sharknado"],
};

export default Necas;
